import React, {Component} from 'react';
import { Image } from 'react-native';
import { StyleSheet, View, Alert } from 'react-native';
import { Container, Content, Left, Right, Icon, Thumbnail, Card, CardItem, Body, Text, Button, Item } from 'native-base';

export default class Products extends Component{
    componentDidMount = () => {
        fetch('https://api.github.com/repositories',{ method: 'GET'})
          .then(response => {
              return response.json();
          })
          .then(response =>{
            console.log(response);
          })
          .catch((error) => {
            console.error(error,"ERRRRRORRR");
          });         
    }
    render(){
        return(
                  <Card>
                    <CardItem>
                      <Left>
                        <Image source={{uri: 'https://unsplash.com/photos/-Dq4WLqWCsc'}} style={{height: 200,  flex: 1}}/>
                        <Body>
                          <Text>NativeBase</Text>
                          <Text note>GeekyAnts</Text>
                        </Body>
                      </Left>
                    </CardItem>
                    <CardItem cardBody>
                    </CardItem>
                    <CardItem>
                      <Left>
                        <Button transparent>
                          <Icon active name="thumbs-up" />
                          <Text>12 Likes</Text>
                        </Button>
                      </Left>
                      <Body>
                        <Button transparent>
                          <Icon active name="chatbubbles" />
                          <Text>4 Comments</Text>
                        </Button>
                      </Body>
                      <Right>
                        <Text>11h ago</Text>
                      </Right>
                    </CardItem>
                  </Card>
        )
    }
}
const styles = StyleSheet.create({
  bgGray: {
      backgroundColor: '#00148A',
  },
  textCenter: {
    textAlign: 'center',
    width: '100%',
    fontWeight: 'bold',
    fontSize: 19
  },
  content: {
      flex: 1,
      justifyContent: 'center',
  },
  bodyCard: {
      borderColor: 'transparent',
      borderStyle: 'dashed',
      borderBottomColor: 'transparent',
      borderTopColor: 'transparent',     
  },
  bgCardItem: {
      backgroundColor: 'rgba(255, 255, 255, 0.6)',
      borderColor: 'transparent',
      borderStyle: 'dashed',
      borderRadius: 0,      
  },
  bgCard: {
    backgroundColor: 'transparent',
    borderRadius: 3,
    height: 320,
    borderColor: 'transparent',
  },
  buttonRight: {
      left: '0%',
  },
  buttonLeft: {
      right: '0%',
      marginRight: 20,
      marginLeft: 20
  },
  container: {
    flex: 1,
    width: '100%',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
